import React from 'react';
import Navbar from './Navbar';
import MainContent from './MainContent';
import Contact from './ContactSection';

const Home = () => {
    return (
        <div>
            <Navbar />
            <MainContent />
            <Contact />
        </div>
    );
};

export default Home;
